                                <h3 class="icon-text-number__title"><strong>FLIRT</strong> <span>- общение с легким
                                        эротическим
                                        подтекстом</span></h3>
                                <p class="icon-text-number__text">Общайся с одинокими людьми, поддерживай, сопереживай,
                                    проявляй интерес к увлечениям посетителя, флиртуй и заводи дружбу.</p>
