                <div class="content">
                    <div class="wrapper__section-titles">
                        <h2 class="section__title">Получай максимум возможностей, которые открывает вебкам</h2>
                        <p class="section__title-text middle">Работая вебкам моделью, ты сама формируешь свою жизнь</p>
                    </div>
                    <ul class="text-list">
                        <li class="text-list__item">
                            <h5 class="text-list__title"><span class="text-list__number">01.</span> Зарабатывай
                                достойные деньги</h5>
                            <p class="text-list__text">Ты получаешь деньги за каждую минуту индивидуального шоу.</p>
                        </li>
                        <li class="text-list__item">
                            <h5 class="text-list__title"><span class="text-list__number">02.</span>
                                Развивай свою харизм и иностранные языки
                            </h5>
                            <p class="text-list__text">
                                Мы поможем тебе раскрыть все твои особенности в лучшем свете, ты еще больше полюбишь себя,
                                а мужчины будут восхищаться тобой! Постоянное общение с иностранцами так же будет способствовать
                                улучшению иностранного языка.
                            </p>
                        </li>
                        <li class="text-list__item">
                            <h5 class="text-list__title"><span class="text-list__number">03.</span> Работай удаленно из
                                дома</h5>
                            <p class="text-list__text">Больше никаких поездок на работу в час-пик, нервных начальников
                                и работы с 8 до 5. Мы согласовываем удобный для тебя график и ты работаешь прямо из дома!
                            </p>
                        </li>
                        <li class="text-list__item">
                            <h5 class="text-list__title"><span class="text-list__number">04.</span> Путешествуй</h5>
                            <p class="text-list__text">Для того, чтобы работать в вебкам индустрии, подойдет любое
                                устройство (телефон, ноутбук, компьютер) с веб камерой и выходом в интернет. Поэтому ты
                                можешь вести трансляцию из любого города мира, параллельно загорая на пляже
                                под солнцем.</p>
                        </li>
                    </ul>
                    <button class="button js-btnToModal" data-type="sign-up" data-text="стать моделью">стать
