            <section class="your-income">
                <div class="backgrounds backgrounds__your-income" data-src="backgrounds backgrounds__your-income"></div>
                <div class="content">
                    <div class="wrapper__section-titles">
                        <h2 class="section__title center">Зарабатывай достойные деньги</h2>
                        <p class="section__title-text center normal">Твой заработок зависит от количества часов, которые
                            ты будешь вести трансляцию. Чем дольше трансляция - тем больше заработок.</p>
                        <p class="section__title-text center normal">На начальном этапе ты сможешь зарабатывать от 50$
                            за смену 4-5 часов.
                        </p>
                    </div>
